                          <thead className="text-start">
                            <tr>
                              <th>S.No</th>
                              <th>Category Name</th>
                              <th>RSS Name</th>
                              <th>Status</th>
                              <th>Received on</th>
                              <th>Published on</th>
                              <th>Edited on</th>
                              <th>View</th>
                              <th>Actions</th>
                              <th>Uploaded by</th>
                            </tr>
                          </thead>
                          <tbody className="text-start">
                            {posts.map((item, index) => (
                              <tr key={index}

                              >
                                <td>{index + 1 + currentPage * pageSize}</td>
                                <td>{item.categoryName}</td>
                                <td>{item.postTitle}</td>
                                <td>{item.status === 1 ? "Publish" : "Pending"}</td>
